def checkVertical(pos,move):
    d=dir[move]
    newPos = [pos[0],pos[1]]
    if data[newPos[0]][newPos[1]] == "#":return False
    if data[newPos[0]][newPos[1]] == ".":return True

    if data[newPos[0]][newPos[1]] == "[":
        return checkVertical([newPos[0]+d[0],newPos[1]+d[1]],move) and checkVertical([newPos[0]+d[0],newPos[1]+d[1]+1],move)
    else:
        return checkVertical([newPos[0]+d[0],newPos[1]+d[1]],move) and checkVertical([newPos[0]+d[0],newPos[1]+d[1]-1],move)

def moveVertical2(pos,move):
    d=dir[move]
    newPos = [pos[0],pos[1]]
    if data[newPos[0]][newPos[1]] == "#":return 
    if data[newPos[0]][newPos[1]] == ".":return 

    if data[newPos[0]][newPos[1]] == "[":
        moveVertical2([newPos[0]+d[0],newPos[1]+d[1]],move)
        moveVertical2([newPos[0]+d[0],newPos[1]+d[1]+1],move)
        data[newPos[0]][newPos[1]] = "."
        data[newPos[0]][newPos[1]+1] = "."
        data[newPos[0]+d[0]][newPos[1]] = "["
        data[newPos[0]+d[0]][newPos[1]+1] = "]"
    else:
        moveVertical2([newPos[0]+d[0],newPos[1]+d[1]],move)
        moveVertical2([newPos[0]+d[0],newPos[1]+d[1]-1],move)
        data[newPos[0]][newPos[1]] = "."
        data[newPos[0]][newPos[1]-1] = "."
        data[newPos[0]+d[0]][newPos[1]] = "]"
        data[newPos[0]+d[0]][newPos[1]-1] = "["


def moveVertical(pos,move,par,moved):
    if (pos[0],pos[1]) in moved:return
    # moved.add((pos[0],pos[1]))
    d=dir[move]
    newPos = [pos[0],pos[1]]
    if data[pos[0]][pos[1]] == "[":
        moveVertical([newPos[0]+d[0],newPos[1]+d[1]],move,"[",moved) 
        moveVertical([newPos[0],newPos[1]+1],move,"]" if par=="[" else ".",moved)
    elif data[pos[0]][pos[1]] == "]":
        moveVertical([newPos[0]+d[0],newPos[1]+d[1]],move,"]",moved) 
        moveVertical([newPos[0],newPos[1]-1],move,"[" if par=="]" else ".",moved)
    data[pos[0]][pos[1]] = par
    

